function twoSum(numbers: number[], target: number): number[]{
    //decreasing search space by eliminating out of bounds nums
    let upperBound = target - numbers[0]
    numbers = numbers.filter(num => num <= upperBound)
    if(numbers[0] + numbers[-1] === target)
        return [1, numbers.length]
    
    
    //slowest incrementing to get first num second num is found using findindex method
    // for(let i = 0; i < numbers.length; i++){
    //     let num1 = numbers[i]
    //     let num2 = target - numbers[i]
    //     let index = numbers.findIndex((num, index) => num === num2 && index !== i)
    //     if(index !== -1)
    //         return [i+1,index+1]
    // }

    //2 pointers, faster than above by a lot
    // let l = 0
    // let r = numbers.length - 1
    // while(l < r){
    //     let sum = numbers[l] + numbers[r]
    //     if(sum === target)
    //         return [l+1, r+1]
    //     else if(sum > target)
    //         r--
    //     else if(sum < target)
    //         l++
    // }
    
    //hashmap faster than previous 2 strats
    let map = new Map<number,number>()
    for(let i = 0; i < numbers.length; i++){
        let num1 = numbers[i]
        let num2 = target - num1
        if(map.has(num2))
            return [map.get(num2)!+1, i+1]
        map.set(num1, i)
    }

    //binary search less efficient than hashmap similar runtime to 2 pointers
    // for(let i = 0; i < numbers.length; i++){
    //     let l = i + 1
    //     let r = numbers.length -1
    //     let tmp = target - numbers[i]
    //     while(l <= r){
    //         let mid = l + Math.floor((r-l)/2)
    //         if(numbers[mid] === tmp)
    //             return [i+1,mid+1]
    //         else if(numbers[mid] < tmp)
    //             l = mid+1
    //         else
    //             r = mid-1
    //     }
    // }

    return []
}
